import ProductList from "./ProductList";
// import { useEffect } from "react";
import { connect } from 'react-redux';
import { setNftDataThunk, isFetchingCreactor, setNftData } from '../../redux/productPageReducer.tsx';
import React from "react";

class ProductListContainer extends React.Component {

    componentDidMount() {
        // this.props.setNftDataThunk();   
        isFetchingCreactor(true);
        debugger
        fetch('http://localhost:8000/Products', {method: 'GET'})
            .then(response => response.json())
            .then(data => {
                setNftData(data)
                isFetchingCreactor(true)
            })
    }

    render() {
        return (
            <ProductList nft={this.props.nft} />
        )
    }
}

const mapDispatchToProps = {
    setNftDataThunk
}

const mapStateToProps = (state) => {
    return {
        nft: state.productPage.nft,
        productPage: state.productPage
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(ProductListContainer);
